import { ListGroup, ListGroupItem } from "shards-react";
class Course extends React.Component
{


  render() {


    return(
        <Container>

      <Row style={{ paddingTop: "10px" }}>

        <Col sm={{ size: 8, order: 2, offset: 2 }}>
          <Card> 
            <CardHeader><strong>Register </strong></CardHeader>

            <CardBody>
